import React, { Component } from 'react';
import Navigation from './components/Navigation/Navigation';
import Header from './components/Header/Header';
import FieldGenerator from './components/FieldGenerator/FieldGenerator';
import PercentWizard from "./components/FieldGenerator/PercentWizard";
import DollarWizard from "./components/FieldGenerator/DollarWizard";
import "tachyons";
import './App.css';

class App extends Component {
  constructor() {
    super();
    this.state = {
    input: '',
    addPercentField: [],
    addDollarField: [],
    route: 'signin',
    isSignedIn: false,
    user: {
        id: '',
        name: '',
        email: '',
        entries: 0,
        joined: ''
    }
    }
  }

  addPercentField = () => {
    const percentArrayLength=this.state.addPercentField.length;
    if (percentArrayLength === 0) {
      return {PercentWizard}
    } else {
        console.log(this.state.addPercentField)
    };
    console.log(this.state.addPercentField);
}

  addDollarField = () => {
    const dollarArrayLength=this.state.addDollarField.length;
    if (dollarArrayLength === 0) {
      return {DollarWizard}
    } else {
        console.log(this.state.addDollarField)
    };
    console.log(this.state.addDollarField);
}

  render() {
    return (
      <div>
        <Navigation />
        <Header />
        <FieldGenerator addPercentField={this.addPercentField} addDollarField={this.addDollarField}/>
      </div>
    )
  }  
}


export default App;
